column7:
Take the following measures only if the sub code shows the first axis of a multi-drop encoder (usually S axis);
(1)Turn the power OFF then back ON.
(2)If the alarm occurs again, replace the Connector board.

In case of using a ASF04 board (collaborative robot), take the following measures only if the sub code shows the first axis of a multi-drop encoder (usually S axis) or a serial encoder (external axis);
(1)Turn the power OFF then back ON.
(2)If the alarm occurs again, replace the ASF04 board. Save the CMOS.BIN before replace the board to be safe.

Take the following measures only if the sub code shows the first axis of a multi-drope encoder (usually S axis);
(1)Turn the power OFF then back ON.
(2)If the alarm occurs again, replace the Connector board.

In case of using a ASF04 board (collaborative robot), take the following measures only if the sub code shows the first axis of a multidrop encoder (usually S axis) or a serial encoder (external axis);
(1)Turn the power OFF then back ON.
(2)If the alarm occurs again, replace the ASF04 board. Save the CMOS.BIN before replace the board to be safe.
